const initialState = {
  data : false,
  files: false,
  blob: false,
  branches: false,
  info: false,
  pulls: false,
  pull: false,
  id: false,
  cid: false,
  issues: false,
  blobissue: false,
  contract: false,
  repos: false
}

const RepositoryReducer = (state = initialState, action) =>{
  switch (action.type) {
    case 'ADD_REPOS':{
      return {
        repos: action.repos
      }
    }
    case "STAR": return {
      data: [action.repos]
    };
    case "UNSTAR": return {
      data: [action.repos]
    };
    case "TOGGLE_STAR":
      return {
      data: [action.repos]
    }
    case "ADD_FILES":{
      return {
        files: action.files,
        info: action.repo,
        issues: state.issues,
        branches: action.branches,
        id : action.id,
        pulls: state.pulls,
        cid: action.cid
      }
    }
    case "ADD_BLOB":
      return{
        files: [...state.files],
        blob: action.blob
      }
    case "NEW_REPO":{
      return{
        data: action.data
      }}
    case 'ADD_REPO':{
      return{
        info: action.repo
      }
    }
    case 'ADD_BRANCHES':{
      return{
        files:  state.files,
        info: state.info,
        blob: state.blob,
        issues: state.issues,
        branches: action.branches,
        pulls: state.pulls,
        id: state.id,
        cid: state.cid
      }
    }
    case 'ADD_BRANCH':{
      return{
        new_branch: action.branch,
        files:  state.files,
        info: state.info,
        issues: state.issues,
        blob: state.blob,
        branches: state.branches,
        pulls: state.pulls,
        id: state.id,
        cid: state.cid
      }
    }
    case 'ADD_PULL':{
      return{
        pulls: action.pull,
        issues: state.issues,
        new_branch: state.branch,
        files:  state.files,
        info: state.info,
        blob: state.blob,
        id: state.id,
        branches: state.branches,
        cid: state.cid,
      }
    }
    case 'ADD_SINGLE_PULL':{
      return{
        pull: action.pull,
      }
    }
    case 'ADD_ISSUE':{
      return{}
    }
    case 'ADD_ISSUES':{
      return{
        pulls: state.pulls,
        new_branch: state.branch,
        files:  state.files,
        info: state.info,
        blob: state.blob,
        id: state.id,
        branches: state.branches,
        issues: action.issues,
        cid: state.cid
      }
    }
    case 'ADD_ISSUE_BLOB':{
      return{
        blobissue: action.issue,
      }
    }
    case 'SET_CONTRACT':{
      return{
        contract: true
      }
    }
    case 'UPDATE_REPO':{
      let new_repos = []
      new_repos = Object.assign(new_repos,state.repos);
      let index = new_repos.findIndex(o => o.repoID===action.repo.repoID);
      new_repos.splice(index,1,action.repo);
      return{
        repos: new_repos
      }
    }
    default: return state;
  }

};

export const getRepos = state => state.repos.repos;
export const getRepo = state => state.repos.info;
export const getFiles = state => state.repos.files;
export const getBlob = state => state.repos.blob;
export const getNewRepo = state => state.repos.data;
export const getOrigin = state => state.repos.origin;
export const getBranches = state => state.repos.branches;
export const getPulls = state => state.repos.pulls;
export const getID = state => state.repos.id;
export const getContract = state=> state.repos.contract;
export const getPull = state => state.repos.pull;
export const getIssues = state => state.repos.issues;
export const getIssueBlob = state => state.repos.blobissue;
export const getCID = state => state.repos.cid;

export default RepositoryReducer;
